import * as React from 'react';
import './App.css';

const Header = (props) => {

  const handleDiv = () => {
    alert("Este es el header");
  }

  return(
    <div onClick={handleDiv} className="header">
        <p>{props.title}</p>
        <p>{props.subTitle}</p>
    </div>
  );
}

export default Header;
